        '<div fxFlex fxLayout="column" fxLayoutAlign="center">' +
           '<div class="title">${entityLabel}</div>' +
           '<div class="subtitle">${entityName}</div>' +
        '</div>' +
        '<div fxLayout="column" fxLayoutAlign="center" style="padding-right: 24px;">' +
            '<button (click)="darkMode = '+darkModeExpression+' ? false : true" id="dark-mode-switch" mat-icon-button matTooltip="{{ '+ darkModeExpression +' ? &quot;Switch to light mode&quot; : &quot;Switch to dark mode&quot; }}"><mat-icon>{{ '+ darkModeExpression +' ? &quot;light_mode&quot; : &quot;dark_mode&quot; }}</mat-icon></button>' +
